import React from 'react';
import { Link } from 'react-router-dom';

const ListStg = (props) => {
    return (
        <div>
            <h1>Liste Des stagiaires</h1>
            <Link to="/AjouterStagiaire"><button type='button' >Ajouter Stagiaire</button></Link>
            <table>
                <tr>
                    <th>id :</th>
                    <th>Image</th>
                    <th>nom</th>
                    <th>prenom</th>
                    <th>email</th>
                </tr>
                {props.liststg.map((e)=>
                    <tr key={e.id}>
                        <td> id: {e.id}</td>
                        <td><img src={`/${e.image}`} alt="photo" style={{width:"30px"}}/> </td>
                        <td>{e.nom}</td>
                        <td>{e.prenom}</td>
                        <td>{e.email}</td>
                        <button type='modifier'></button>
                        <button></button>
                    </tr>
                )}

            </table>
        </div>
    );
}

export default ListStg;
